goog.require("axs.AuditRules");goog.require("axs.constants.Severity");goog.require("axs.utils");axs.AuditRules.addRule({name:"elementsWithMeaningfulBackgroundImage",severity:axs.constants.Severity.WARNING,relevantElementMatcher:function(element,flags){return!flags.hidden},heading:"Meaningful images should not be used in element backgrounds",url:"https://github.com/GoogleChrome/accessibility-developer-tools/wiki/Audit-Rules#ax_image_01",test:function(el){if(el.textContent&&0<el.textContent.length){return!1}var style=window.getComputedStyle(el,null),bgImage=style.backgroundImage;if(!bgImage||"undefined"===bgImage||"none"===bgImage||0!=bgImage.indexOf("url")){return!1}var width=parseInt(style.width,10),height=parseInt(style.height,10);return 150>width&&150>height},code:"AX_IMAGE_01"});